import React, { useEffect, useState } from 'react'
import AdminNav from './AdminNav'
import { Link } from 'react-router-dom'

const Approvetrials = () => {
    const [data, setData] = useState([]);
    const fetchApi = async () => {
        var value = await fetch("http://localhost:5000/appointment");
        value = await value.json();
        setData(value);
    };
    useEffect(() => {
        fetchApi();
    }, []);
    return (
        <div>
          <AdminNav />
            
                  
                
                <div className='col-9' id='Dashboard'>
                    
                    <div><h3>User's Appointment Requests</h3></div>
                    <div className='container'>
                        <h2 className='text-center display-3'>All Appointments</h2>
                        <table className='table table-bordered mt-5'>
                            <tr>
                                
                                <th>Name</th>
                                <th>Email</th>
                                <th>Gender</th>
                                <th>City</th>
                                <th>Phone</th>
                                <th>Time</th>
                                <th>Day</th>
                                <th>User's Day</th>
                                <th>User's Time</th>
                                <th colSpan={2} className='text-center'>Action</th>

                            </tr>
                            {
                                data.map((item) => (
                                    <tr>
                                    
                                        <td>{item.name}</td>
                                        <td>{item.email}</td>
                                        <td>{item.gender}</td>
                                        <td>{item.city}</td>
                                        <td>{item.phone}</td>
                                        <td>{item.time}</td>
                                        <td>{item.days}</td>
                                        <td>{item.usertime}</td>
                                        <td>{item.userday}</td>
                                        <td><Link to="/update"><button className='btn btn-primary'>Confirm</button></Link></td>
                                        <td><Link><button className='btn btn-danger'>Delete</button></Link></td>

                                    </tr>
                                ))
                            }
                        </table>
                    </div>
                </div>
            
        </div>
    )
}

export default Approvetrials
